import axios from 'axios';

const KEY = 'AIzaSyBUjXmxeTZfVkcC-mUGCblZw-i90yQG4XA';

export default axios.create({
    baseURL: 'https://www.googleapis.com/youtube/v3',
    params: {
      part: 'snippet', 
      type: 'video',
      maxResults: 5,
      key: KEY
  }
});
